import{_ as e,c as t,q as r,o}from"./chunks/framework.BRsttz9t.js";const p="/assets/track-1.92wc2X0b.jpg",s="/assets/track-2.CNxDMruG.jpg",d="/assets/track-3.B0IR02Ux.jpg",m=JSON.parse('{"title":"PaddlePaddle Hackathon Episode 03 | 创新碰撞，技术狂欢，飞桨黑客马拉松第五期活动圆满收官！","description":"","frontmatter":{"title":"PaddlePaddle Hackathon Episode 03 | 创新碰撞，技术狂欢，飞桨黑客马拉松第五期活动圆满收官！","date":"2023-12-25T00:00:00.000Z","author":{"name":"花花","github":"Tulip-hua"},"co_authors":[{"name":"梦师傅","github":"Ligoml"}],"category":"community-activity"},"headers":[],"relativePath":"posts/hackathon-5th-episode03.md","filePath":"posts/hackathon-5th-episode03.md"}'),l={name:"posts/hackathon-5th-episode03.md"};function i(h,a,n,c,u,P){return o(),t("div",null,[...a[0]||(a[0]=[r('<p>让我们看看哪些最强“Hacker”脱颖而出！</p><p>这是一次好奇心的远航，也是一场创作激情与团队协作的较量。</p><p>你懂技术，有想法，在这里可以尽情发挥！</p><p>我们希望你，不只埋头创造，一起享受不确定的乐趣，才能涌现意想不到的灵感和收获。</p><p>在这里，不止精益求精的竞技，去结识志同道合的小伙伴，去和研发导师 1V1 深度交流。</p><p>在飞桨黑客松的舞台上，创造力释放，“码”上见真章！</p><p>经过激烈的角逐，让我们看看哪些最强“Hacker”脱颖而出！</p><h2 id="_01-高手云集的飞桨黑客松活动" tabindex="-1">01 - 高手云集的飞桨黑客松活动 <a class="header-anchor" href="#_01-高手云集的飞桨黑客松活动" aria-label="Permalink to &quot;01 - 高手云集的飞桨黑客松活动&quot;">​</a></h2><p>PaddlePaddle Hackathon 飞桨黑客马拉松（以下简称为“飞桨黑客松”）第五期活动自 2023 年 9 月中旬发布后，开发者热情响应，比赛历经三个月完美收官！</p><p>本次活动任务难度持续升级，飞桨联合 OpenVINO™ 等生态伙伴发布 100+ 开源贡献任务。赛制全新升级，本期黑客松活动在延续开源贡献个人挑战赛的基础上，首次探索以 Code Camp 形式组织开源活动，1 对 1 带教形式，并由开发者担任助教。并发布全新赛道——大模型应用与创意赛，基于文心大模型，创意无限，打开想象力，开发 AI 原生应用。</p><p>共有 800+ 位社区开发者参与到飞桨黑客松中，160+ 支队伍进行任务认领，<strong>本期黑客松活动在任务完成数量、参与团队规模、项目类型丰富度等方面均有提升，足可见开发者们建设飞桨和文心生态的热情。</strong> 我们期待这些开发者团队持续在飞桨开源生态中迸发出光彩和力量，与飞桨一路同行，一起建设更优雅的飞桨开源社区。</p><h2 id="_02-三大赛道-开源贡献" tabindex="-1">02 - 三大赛道 开源贡献 <a class="header-anchor" href="#_02-三大赛道-开源贡献" aria-label="Permalink to &quot;02 - 三大赛道 开源贡献&quot;">​</a></h2><p>飞桨与生态伙伴携手，发布了三大赛道共计 26 个方向的开源贡献任务，从框架开发、模型套件开发、论文复现、硬件部署到产业应用任务应有尽有。开发者们结合自己的兴趣与能力在不同方向为飞桨做出重要贡献，感谢你们！</p><h3 id="开源贡献个人挑战赛" tabindex="-1">开源贡献个人挑战赛 <a class="header-anchor" href="#开源贡献个人挑战赛" aria-label="Permalink to &quot;开源贡献个人挑战赛&quot;">​</a></h3><p>发布 124 个开源贡献任务，包括框架、科学计算、套件和合作伙伴方向，与 OpenVINO™、海光、Arm、高通、Zilliz、开放麒麟社区、9#AISoft 等合作项目共同出品，<strong>120 个任务完成认领，96 个任务提交作品，85 个任务顺利完成，完成率 70%</strong>，感谢各位开发者的积极参与，致敬每一个开源贡献！</p><p>在第五期飞桨黑客松个人挑战赛中，开发者们码力全开，共计为飞桨新增 50+ API，增加 6 组共计 120+ API 转换规则，15 个 PHI 算子迁移、4 个分布式切分推导规则和 3 个转换函数，完成 9 篇 AI4S 领域论文代码复现，为大模型套件 PaddleMIX、PaddleNLP 及计算机视觉套件 PaddleSeg、PaddleClas、PaddleDetection 新增 10 个重要模型或新功能，为全套件模型接入动转静训练功能，为飞桨开源社区伙伴 OpenVINO™、Arm、InfiniTensor 新增 12 个新功能。</p><blockquote><p>注：部分任务还有细节需要沟通，暂未完成 PR 合入，请锁定任务的开发者尽快完成 PR 合入哦~</p></blockquote><p>更多详情请查看 issue：<a href="https://github.com/PaddlePaddle/Paddle/issues/57262" target="_blank" rel="noreferrer">https://github.com/PaddlePaddle/Paddle/issues/57262</a></p><h3 id="大模型应用与创意赛" tabindex="-1">大模型应用与创意赛 <a class="header-anchor" href="#大模型应用与创意赛" aria-label="Permalink to &quot;大模型应用与创意赛&quot;">​</a></h3><p>作为飞桨星河社区五周年预热活动，共发布趣味创意与生产力工具 2 个方向的任务，鼓励开发者发挥想象力和创新精神，构思基于文心大模型的创意方案，开发创新应用，从技术创新到应用实践，<strong>共有 37 名开发者产出基于 EB SDK 的应用 60+ 个，作品种类多样，涵盖多领域</strong>，欢迎大家进入飞桨星河社区应用中心体验。</p><blockquote><p>趣味创意赛道一等奖作品：<a href="https://aistudio.baidu.com/application/detail/10863" target="_blank" rel="noreferrer">AI 数字人 | 数字诗人&amp;数字发言人&amp;数字人聊天</a></p><p>生产力工具赛道一等奖作品：<a href="https://aistudio.baidu.com/projectdetail/7277555" target="_blank" rel="noreferrer">【Hackathon 5th】基于文心一言的日报系统</a></p></blockquote><p>更多详情请查看 issue：<a href="https://github.com/PaddlePaddle/Paddle/issues/57585" target="_blank" rel="noreferrer">https://github.com/PaddlePaddle/Paddle/issues/57585</a></p><h3 id="飞桨护航计划集训营" tabindex="-1">飞桨护航计划集训营 <a class="header-anchor" href="#飞桨护航计划集训营" aria-label="Permalink to &quot;飞桨护航计划集训营&quot;">​</a></h3><p>发布 18 个框架与套件开发项目，1 对 1 带教形式，完成 18 名学员招募，共计提交 4 期周报，组织 5 期技术分享会，9 名学员进行技术分享，15 名学员通过考核。<strong>这是飞桨开源社区首次 Code Camp 形式的开源活动，所有学习笔记与周报记录留存在开源项目 PFCCLab/Camp 中，欢迎大家围观交流</strong>。</p><blockquote><p>集训营开源项目地址：<a href="https://github.com/PFCCLab/Camp" target="_blank" rel="noreferrer">https://github.com/PFCCLab/Camp</a></p></blockquote><p>本期飞桨护航计划集训营开发项目内容硬核，既包括自动微分、新 IR Pass、自动混合精度、组合机制前反向统一、量化推理、算子类型扩展到复数、分布式能力建设与架构升级等核心组件开发工作，还有科学计算领域拓展专项、套件压缩能力建设、多模态大模型全流程建设等重要套件能力建设工作，营员们的开发能力、开源热情与丰富成果不仅得到了各位导师的高度认可，也获得了研发经理的肯定，3 名同学获得百度正式实习生 Offer。</p><p>更多详情请查看 issue：<a href="https://github.com/PaddlePaddle/Paddle/issues/57264" target="_blank" rel="noreferrer">https://github.com/PaddlePaddle/Paddle/issues/57264</a></p><h2 id="_03-飞桨黑客松完成榜单" tabindex="-1">03 - 飞桨黑客松完成榜单 <a class="header-anchor" href="#_03-飞桨黑客松完成榜单" aria-label="Permalink to &quot;03 - 飞桨黑客松完成榜单&quot;">​</a></h2><p>2023 PaddlePaddle Hackathon 飞桨黑客马拉松第五期由深度学习技术及应用国家工程研究中心主办，飞桨承办，英特尔作为顶级赞助方，OpenVINO™、华为、海光、Arm、高通、Zilliz、开放麒麟社区等共同出品，以线上认领任务的形式进行。 本次共有三大赛道：开源贡献个人挑战赛、大模型应用与创意赛、飞桨护航计划集训营。根据开发难度分为基础任务和进阶任务，为大家提供丰富的深度学习开发体验。对飞桨黑客松第五期公示榜单如有异议，请于 2023 年 12 月 25 日 24 点前反馈至 <a href="mailto:paddle-hack@baidu.com" target="_blank" rel="noreferrer">paddle-hack@baidu.com</a> ，我们将在 12 月 26 日前对您的异议进行复核反馈。</p><p><img src="'+p+'" alt="hackathon-5th-track-1"></p><p><img src="'+s+'" alt="hackathon-5th-track-2"></p><p><img src="'+d+'" alt="hackathon-5th-track-3"></p><p>恭喜完成开发任务的团队，将获得任务对应奖金以及飞桨黑客松结项证书，同时也可以获得百度招聘绿色通道。</p><h2 id="_04-新的身份等你点亮" tabindex="-1">04 - 新的身份等你点亮 <a class="header-anchor" href="#_04-新的身份等你点亮" aria-label="Permalink to &quot;04 - 新的身份等你点亮&quot;">​</a></h2><p>在参与飞桨黑客松活动时，部分开发者们向飞桨框架提交 PR（Pull Request）参与开源贡献，成为飞桨框架的贡献者，并且有意愿为飞桨框架做出持续的贡献。他们接受了来自 PFCC 的邀请，正在用自己的方式参与飞桨框架建设，与飞桨共同成长。如果你也热爱开源、如果你有意愿成为飞桨开源社区的 Contributor，就快加入 PFCC 吧！</p><blockquote><p><strong>关于 PFCC</strong></p><p>PFCC 全称 Paddle Framework Contributor Club ，意为飞桨框架贡献者俱乐部，是一个有兴趣、正在或者已经为飞桨开源框架做开源贡献的贡献者成立的虚拟组织。在这里，飞桨开源框架的贡献者进行讨论、交流和分享，并为飞桨框架做出持续的贡献。如果你有意愿加入我们，请发邮件到 <a href="mailto:ext_paddle_oss@baidu.com" target="_blank" rel="noreferrer">ext_paddle_oss@baidu.com</a>，在邮件中附上自己的 GitHub ID、贡献详情与联系方式，会有工作人员邀请你加入。</p></blockquote><p><strong>加入 PFCC，与我们一起参与到飞桨框架的开发中吧！</strong></p><p>戳这里看飞桨开源社区故事 <strong>➡️</strong> <a href="https://pfcc.blog/" target="_blank" rel="noreferrer">https://pfcc.blog/</a></p><p>原文链接：<a href="https://mp.weixin.qq.com/s/Yjvwj8br84sPard1lLoNOQ" target="_blank" rel="noreferrer">https://mp.weixin.qq.com/s/Yjvwj8br84sPard1lLoNOQ</a></p>',39)])])}const k=e(l,[["render",i]]);export{m as __pageData,k as default};
